import styles from './FeedbackStats.module.css';

const FeedbackStats = ({good, neutral, bad, total, positivePercentage}) => {
    return (
        <div>
            <h2>Statistics</h2>
            <ul className={styles.options}>
                <li><p>Good: {good}</p></li>
                <li><p>Neutral: {neutral}</p></li>
                <li><p>Bad: {bad}</p></li>
                <li><p>Total:{total}</p></li>
                <li><p>Positive feedback:{positivePercentage}%</p></li>
            </ul>
        </div>
    )
}

export default FeedbackStats
